import React, { Component } from 'react';

class Signup extends Component {
    render() {
        return (
                  <div className="App">
      <form action >
        <TextField
        label="Player1" /> <br />
        <TextField
        label="Player2" /> <br /> <br />
        <Button onClick = {this.handleButtonClick}> Let's Play! </Button>
      </form>
        </div>
        )
    }
}

export default Signup;
